    authDomain: "ionicvsk.firebaseapp.com",
    databaseURL: "https://ionicvsk.firebaseio.com",
    projectId: "ionicvsk",
    storageBucket: "",
    messagingSenderId: "589403062376"
});

class Dashboard extends React.Component {

  render() {
    return (
      <div>
          Dashboard
      </div>
    );
  }
}

export default (Dashboard);
